import * as React from 'react';
import RSVPPersonal from './personal';
import RSVPEntity from './entity';
import RSVProxyHolder from './proxy-holder';

const rsvpTypes = [
    {
        text: "Personal",
        value: "personal",
    },
    {
        text: "Entity",
        value: "entity",
    },
    {
        text: "Proxy Holder",
        value: "proxyholder",
    },
];

export default class RSVPForm extends React.Component {

    render () {
        return (
            <div class="rsvp-form-wrapper">
                <select onChange="handleRSVPTypeChange()">
                    {rsvpTypes.map(type => (<option value={type.value}>{type.text}</option>))}
                </select>
                <RSVPPersonal />
                <RSVPEntity />
                <RSVProxyHolder />
            </div>
        )
    }
}
